PREFIX pl: <http://www.w3.org/1999/02/22-rdf-syntax-ns#PlainLiteral>

SELECT DISTINCT ?procedureDescription
WHERE {
  ?patient a syn:Patient ;
          syn:conditionId ?conditionId .
  ?condition a syn:Condition ;
             syn:code snomed:415322002 ;
             syn:patientId ?patientId ;
             syn:description 'Mold (organism)'^^pl: .
  ?encounter a syn:Encounter ;
             syn:id ?encounterId ;
             syn:patientId ?patientId ;
             syn:procedureId ?procedureId ;
             syn:date ?encounterDate .
  ?procedure a syn:Procedure ;
             syn:id ?procedureId ;
             syn:description ?procedureDescription ;
             syn:date ?procedureDate .
  FILTER(?encounterDate <= ?procedureDate)
  FILTER(NOT EXISTS {
          ?procedure2 a syn:Procedure ;
                     syn:id ?procedureId ;
                     syn:date ?procedureDate2 ;
                     syn:date ?procedureDate3 .
          FILTER(?procedureDate2 > ?procedureDate3 && ?procedureDate2 < ?procedureDate)
         })
}
ORDER BY DESC(COUNT(?procedureId))

